\begin{tikzpicture}[x=1in, y=1in, z=(45:-.4)]
\clip (-\QP/2,-\QP/2) rectangle (\QP/2,.7);
\def\xchange{-1}
\def\ychange{-1}

% 2x2 square base (4 cubes)
\foreach \x/\y/\z in {
0/0/0,
1/0/0,
0/1/0,
1/1/0
}{\Ucube{\x}{\y}{\z}{\xchange}{\ychange};}

